import React from 'react'
import { BrowserRouter as Router, Route, Switch } from "react-router-dom"

export function Navigation() {
    return (
        // Router -> Es el contenedor de la navegacion
        // Switch -> sirve para cuando encuentre la ruta, carga esa ruta en especifica y no cargue mas
        <Router>
            <Switch>
                <h2>Navigation...</h2>
            </Switch>
        </Router>
    );
}
